import './App.css';
import { BrowseRouter as Router, Route, Switch } from 'react-router-dom'
import homePage from '/components/homePage/homePage.js'

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={homePage} />
      </Switch>
    </Router>
  );
}

export default App;
